const aliveStateName = 'controlLoopAlive' + api.knyteId;
const lastNowName = 'lastNow' + api.knyteId;

const offsetSpeed = 400; // pixels in second
const offsetKnoxelId = 'ba50d604-a05f-46dc-9ce6-efd85912bf1f';

if (api.event === 'enter')
{
	api.inputOptions.handleMouseClick = false;
	api.inputOptions.handleKeyPress = false;
	window[aliveStateName] = true;
	function controlLoop()
	{
		if (!window[aliveStateName])
			return;
		const lastNow = window[lastNowName];
		const now = performance.now();
		if (lastNow !== undefined)
		{
			const deltaInSeconds = 0.001 * (now - lastNow);
			const offset = offsetSpeed * deltaInSeconds;
			const codeToOffsetMap = {
				'KeyW': function() {return {x: 0, y: -offset};},
				'KeyA': function() {return {x: -offset, y: 0};},
				'KeyS': function() {return {x: 0, y: offset};},
				'KeyD': function() {return {x: offset, y: 0};},
			};
			let {x, y} = api.getKnoxelPosition(
				api.knyteId, offsetKnoxelId
			);
			for (let code in codeToOffsetMap)
			{
				if (!(code in api.inputCodeMap))
					continue;
				const offset = codeToOffsetMap[code]();
				x += offset.x;
				y += offset.y;
			}
			api.setKnoxelPosition(
				api.knyteId, offsetKnoxelId, {x, y}
			);
		}
		window[lastNowName] = now;
		requestAnimationFrame(controlLoop);
	}
	window[lastNowName] = undefined;
	requestAnimationFrame(controlLoop);
}
else if (api.event === 'leave')
{
	api.inputOptions.handleMouseClick = true;
	api.inputOptions.handleKeyPress = true;
	window[aliveStateName] = false;
}

